import Icon from './Icon'
import Link from 'react-scroll'

export default function ToTop() {
  return (
        <div className="to-top">
            <Link to="#nav" smooth={true} duration={500}>
                <Icon icon="Top" size={30} />
            </Link>
        </div>
  )
}
